export default function Footer(props) {
    return (
        <footer className="App-footer">
            <h1 className="App-title">{props.pageTiltle}</h1>
            <h2>Our team consits of 5 peoples:
                Nguyễn Vinh Quang
                Bùi Gia An
                Phạm Đức Quân
                Nguyễn Thành An
                Phạm Thanh Tú</h2>
        </footer>
    )
}
